import {HStack} from "@chakra-ui/react";
import React, { useEffect, useState} from "react";
import axios from "axios";


import "./App.css"


function App(){

  
  

  function searchByCpf(cpf) {
    setShowError(false);
  
    axios
      .get(`http://localhost:8005/PerguntaSelecionadaPacientes?cpf=${cpf}`)
      .then((response) => {
        const data = response.data;
        if (data.length > 0) {
         
          const matchingResult = data.find((item) => item.cpf === cpf);
  
          if (matchingResult) {
            setInfoPaciente(matchingResult); 
           
          } else {
            setShowError(true); 
          }
        } else {
          setShowError(true); 
        }
      })
      .catch((error) => {
        console.error(error);
        setShowError(true);
      });
  }
  
  useEffect(() => {
    if (cpfInput) {
      searchByCpf(cpfInput);
    }
  }, [cpfInput]);


  

  return(
    <div className="App" >  
    <div  className="Colum"> 
      <div className="cont">
          <center><h2  >Selecionar Pergunta</h2></center>
            <HStack spacing="8">
              <input
                type="text"
                placeholder="Enter CPF"
                onChange={(e) =>(e.target.value)}
              />
   
            <div>
            <Input
                  className="wrap-input"
                  id="cpfInput"
                  value={cpfInput}
                  onChange={(e) => setCpfInput(e.target.value)}
                />                
                {infoPaciente && (
                  <div key={infoPaciente._id}>
                    <p>CPF: {infoPaciente.cpf}</p>
                    <p>Nome: {infoPaciente.name}</p>
                  </div>
                )} 
              </div> 
            </HStack>
            </div>
          
      </div>
    </div>
  )
}

export default App
